import {createBrowserRouter,RouterProvider as route} from 'react-router-dom';
function App() {
  const router=createBrowserRouter({
   path:'/',
   element:<Home/>
  },
)
  return (
    <div className="App">
      <Home/>
      <Login/>
      <Toaster/>
    </div>
  );
}

export default App;
